After the crates have been packed with 200 pipes each, what is the positive difference in the total heights (in cm) of the two packings?

In the circle with center $O$, the measure of $\angle RIP$ is $36^\circ$ and $OR=10$ cm. Find the number of centimeters in the length of arc $RP$. Express your answer in terms of $\pi$. [asy]
draw((1,0)..(0,1)..(-1,0)..(0,-1)..cycle);
draw((0,0)--(4/5,3/5)--(-1,0)--(4/5,-3/5)--cycle);
label("$O$",(0,0),W); label("$I$",(-1,0),W); label("$R$",(4/5,3/5),ENE); label("$P$",(4/5,-3/5),ESE);
[/asy]

The line $y = b-x$ with $0 < b < 4$ intersects the $y$-axis at $P$ and the line $x=4$ at $S$. If the ratio of the area of triangle $QRS$ to the area of triangle $QOP$ is 9:25, what is the value of $b$? Express the answer as a decimal to the nearest tenth.

[asy]
draw((0,-3)--(0,5.5),Arrows);
draw((4,-3.5)--(4,5),Arrows);

draw((-2,0)--(6,0),Arrows);

draw((-2,4.5)--(6,-3.5),Arrows);

dot((0,0));
dot((2.5,0));
dot((4,0));
dot((4,-1.5));
dot((0,2.5));

label("O",(0,0),SW);
label("P",(0,2.5),NE);
label("Q",(2.5,0),NE);
label("R",(4,0),NE);
label("S",(4,-1.5),SW);

label("$y$-axis",(0,5.5),N);
label("$x=4$",(4,5),N);
label("$x$-axis",(6,0),E);
label("$y=b-x$",(6,-3.5),SE);
[/asy]

Find $PQ$ in the triangle below.


[asy]
unitsize(1inch);
pair P,Q,R;
P = (0,0);
Q= (sqrt(3),0);
R = (0,1);
draw (P--Q--R--P,linewidth(0.9));
draw(rightanglemark(Q,P,R,3));
label("$P$",P,S);
label("$Q$",Q,S);
label("$R$",R,N);
label("$9\sqrt{3}$",R/2,W);
label("$30^\circ$",(1.25,0),N);
[/asy]

