Right triangle $ABC$ (hypotenuse $\overline{AB}$) is inscribed in equilateral triangle $PQR,$ as shown.  If $PC = 3$ and $BP = CQ = 2,$ compute  $AQ.$

[asy]
unitsize(0.8 cm);

pair A, B, C, P, Q, R;

P = (0,0);
Q = (5,0);
R = 5*dir(60);
A = Q + 8/5*dir(120);
B = 2*dir(60);
C = (3,0);

draw(A--B--C--cycle);
draw(P--Q--R--cycle);
draw(rightanglemark(A,C,B,10));

label("$A$", A, NE);
label("$B$", B, NW);
label("$C$", C, S);
label("$P$", P, SW);
label("$Q$", Q, SE);
label("$R$", R, N);
label("$2$", (C + Q)/2, S);
label("$3$", (C + P)/2, S);
label("$2$", (B + P)/2, NW);
[/asy]

Below is the graph of $y = a \sin bx$ for some constants $a < 0$ and $b > 0.$  Find $a.$

[asy]import TrigMacros;

size(400);

real g(real x)
{
	return (-2*sin(x/3));
}

draw(graph(g,-3*pi,3*pi,n=700,join=operator ..),red);
trig_axes(-3*pi,3*pi,-3,3,pi/2,1);
layer();
rm_trig_labels(-5, 5, 2);

label("$1$", (0,1), E);
label("$2$", (0,2), E);
label("$-1$", (0,-1), E);
label("$-2$", (0,-2), E);
[/asy]

In triangle $ABC,$ $M$ is the midpoint of $\overline{BC},$ $AB = 12,$ and $AC = 16.$  Let $E$ be on $\overline{AC},$ and $F$ be on $\overline{AB},$ and let $G$ be the intersection of $\overline{EF}$ and $\overline{AM}.$  If $AE = 2AF,$ then find $\frac{EG}{GF}.$

[asy]
unitsize(0.3 cm);

pair A, B, C, E, F, G, M;
real x = 4;

B = (0,0);
C = (18,0);
A = intersectionpoint(arc(B,12,0,180),arc(C,16,0,180));
M = (B + C)/2;
F = interp(A,B,x/12);
E = interp(A,C,2*x/16);
G = extension(E,F,A,M);

draw(A--B--C--cycle);
draw(E--F);
draw(A--M);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$E$", E, NE);
label("$F$", F, NW);
label("$G$", G, SW);
label("$M$", M, S);
[/asy]

The graph of $y = f(x)$ is shown below.

[asy]
unitsize(0.3 cm);

real func(real x) {
  real y;
  if (x >= -3 && x <= 0) {y = -2 - x;}
  if (x >= 0 && x <= 2) {y = sqrt(4 - (x - 2)^2) - 2;}
  if (x >= 2 && x <= 3) {y = 2*(x - 2);}
  return(y);
}

int i, n;

for (i = -8; i <= 8; ++i) {
  draw((i,-8)--(i,8),gray(0.7));
  draw((-8,i)--(8,i),gray(0.7));
}

draw((-8,0)--(8,0),Arrows(6));
draw((0,-8)--(0,8),Arrows(6));

label("$x$", (8,0), E);
label("$y$", (0,8), N);

draw(graph(func,-3,3),red);

label("$y = f(x)$", (4,-3), UnFill);
[/asy]

The graph of $y = g(x)$ is shown below.

[asy]
unitsize(0.3 cm);

real func(real x) {
  real y;
  if (x >= -3 && x <= 0) {y = -2 - x;}
  if (x >= 0 && x <= 2) {y = sqrt(4 - (x - 2)^2) - 2;}
  if (x >= 2 && x <= 3) {y = 2*(x - 2);}
  return(y);
}

real gunc(real x) {
  return(func(-x + 4));
}

int i, n;

for (i = -8; i <= 8; ++i) {
  draw((i,-8)--(i,8),gray(0.7));
  draw((-8,i)--(8,i),gray(0.7));
}

draw((-8,0)--(8,0),Arrows(6));
draw((0,-8)--(0,8),Arrows(6));

label("$x$", (8,0), E);
label("$y$", (0,8), N);

draw(graph(gunc,1,7),red);

label("$y = g(x)$", (4,-3), UnFill);
[/asy]

What is $g(x)$ in terms of $f(x)$?  For example, if you think $g(x) = f(x) + 1,$ enter "$f(x) + 1$", without quotation marks.
